export default function Kontakt(){
   return(
      <div>
         <hr></hr>
         <div className="kontaktKutija">
            <div className="logo"></div>
            <div className="info"></div>
         </div>
         <div class="mapouter"><div class="gmap_canvas"><iframe class="gmap_iframe" width="90%" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="https://maps.google.com/maps?width=1000&amp;height=4-0&amp;hl=en&amp;q=Prirodni kamen dn&amp;t=&amp;z=14&amp;ie=UTF8&amp;iwloc=B&amp;output=embed"></iframe></div></div>
      </div>
   )
}
